--CREATE SCHEMA geo
--    AUTHORIZATION postgres;

DROP TABLE IF EXISTS geo.dtb_municipio;	
CREATE TABLE geo.dtb_municipio
(
    uf character varying(255),
	nome_uf character varying(255),
	mesorregiao_geografica character varying(255),
	nome_mesorregiao character varying(255),
	microrregiao_geografica character varying(255),
	nome_microrregiao character varying(255),
	municipio character varying(255),
	codigo_municipio_completo character varying(255),
	nome_municipio character varying(255)
)
WITH (
    OIDS = FALSE
);

ALTER TABLE geo.dtb_municipio
    OWNER to postgres;
	
